// src/main.ts
var RedPlugin = class extends import_obsidian7.Plugin {
  async onload() {
    this.settingsManager = new SettingsManager(this);
    await this.settingsManager.loadSettings();
    const themeManager = new ThemeManager(this.app, this.settingsManager);
    RedConverter.initialize(this.app);
    DonateManager.initialize(this.app, this);
    this.registerView(
      VIEW_TYPE_RED,
      (leaf) => new RedView(leaf, themeManager, this.settingsManager)
    );
    this.app.workspace.onLayoutReady(() => {
      if (this.app.workspace.getLeavesOfType(VIEW_TYPE_RED).length === 0) {
        const leaf = this.app.workspace.getRightLeaf(false);
        if (leaf) {
          leaf.setViewState({
            type: VIEW_TYPE_RED,
            active: false
            //  false 
          });
        }
      }
    });
    this.addCommand({
      id: "open-mp-preview",
      name: "\u6253\u5F00\u5C0F\u7EA2\u4E66\u56FE\u7247\u9884\u89C8",
      callback: async () => {
        await this.activateView();
      }
    });
    this.addSettingTab(new RedSettingTab(this.app, this));
  }
  async activateView() {
    const leaves = this.app.workspace.getLeavesOfType(VIEW_TYPE_RED);
    if (leaves.length > 0) {
      this.app.workspace.revealLeaf(leaves[0]);
      return;
    }
    const rightLeaf = this.app.workspace.getRightLeaf(false);
    if (rightLeaf) {
      await rightLeaf.setViewState({
        type: VIEW_TYPE_RED,
        active: true
      });
    } else {
      new import_obsidian7.Notice("\u65E0\u6CD5\u521B\u5EFA\u89C6\u56FE\u9762\u677F");
    }
  }
};
